import React from 'react';
import Form from './styles/Form';

const SignIn = () => (
  <Form method="POST">
    <fieldset>
      <label htmlFor="email">
        Email
        <input
          type="email"
          name="email"
          placeholder="Your Email Address"
          autoComplete="email"
        />
      </label>
    </fieldset>
  </Form>
);

export default SignIn;
